import React from 'react';
import { Pricing, DetailedPrice } from './prices-container.styles';

const PricesContainer = () => {
  return (
    <Pricing>
      <DetailedPrice>
        <span>Products</span>
        <span>$0.00</span>
      </DetailedPrice>
      <DetailedPrice>
        <span>Shipping Cost</span>
        <span>$0.00</span>
      </DetailedPrice>
    </Pricing>
  )
}

export default PricesContainer;
